  return (
    <div className="group57Container">
      <div className="group">
        <h1 className="_7BlueInferno">Product Detail Page</h1>
        <p className="price27500">Product ID: {productId}</p>
        <p className="productdescription">
          This page will show more info once connected to the database.
        </p>
      </div>
    </div>
  );
}
